/** 

=========================================================
* Vision UI PRO React - v1.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/vision-ui-dashboard-pro-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com/)

* Design and Coded by Simmmple & Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Visionware.

*/

import React from "react";
import { Card, Stack } from "@mui/material";
import VuiBox from "components/VuiBox";
import VuiTypography from "components/VuiTypography";
import colors from "assets/theme/base/colors";
import { FaEllipsisH } from "react-icons/fa";
import linearGradient from "assets/theme/functions/linearGradient";
import * as GradientProgress from "@delowar/react-circle-progressbar";

function ReferralTracking() {
  const { info, gradients } = colors;
  const { cardContent } = gradients;

  return (
    <Card>
      <VuiBox sx={{ width: "100%" }}>
        <VuiBox
          display="flex"
          alignItems="center"
          justifyContent="space-beetween"
          sx={{ width: "100%" }}
          mb="40px"
        >
          <VuiTypography variant="lg" color="white" mr="auto">
            تتبع الإحالة
          </VuiTypography>
          <VuiBox
            display="flex"
            justifyContent="center"
            alignItems="center"
            bgColor="#22234B"
            sx={{ width: "37px", height: "37px", cursor: "pointer", borderRadius: "12px" }}
          >
            <FaEllipsisH color={info.main} size="18px" />
          </VuiBox>
        </VuiBox>
        <VuiBox
          display="flex"
          sx={({ breakpoints }) => ({
            [breakpoints.up("xs")]: {
              flexDirection: "column",
              gap: "16px",
              justifyContent: "center",
              alignItems: "center",
            },
            [breakpoints.up("md")]: {
              flexDirection: "row",
              justifyContent: "flex-start",
              alignItems: "center",
            },
          })}
        >
          <VuiBox
            direction="column"
            spacing="20px"
            width="500px"
            maxWidth="50%"
            sx={({ breakpoints }) => ({
              mr: "auto",
              [breakpoints.only("md")]: {
                mr: "75px",
              },
              [breakpoints.only("xl")]: {
                width: "500px",
                maxWidth: "38%",
              },
            })}
          >
            <VuiBox
              display="flex"
              width="220px"
              p="20px 22px"
              flexDirection="column"
              mb="20px"
              sx={({ breakpoints }) => ({
                background: linearGradient(cardContent.main, cardContent.state, cardContent.deg),
                borderRadius: "20px",
                [breakpoints.up("xl")]: {
                  maxWidth: "110px !important",
                },
                [breakpoints.up("xxl")]: {
                  minWidth: "180px",
                  maxWidth: "100% !important",
                },
              })}
            >
              <VuiTypography color="text" variant="button" fontWeight="regular" mb="5px">
                مدعو
              </VuiTypography>
              <VuiTypography color="white" variant="lg" fontWeight="bold">
                145 شخصا
              </VuiTypography>
            </VuiBox>
            <VuiBox
              display="flex"
              width="220px"
              p="20px 22px"
              flexDirection="column"
              sx={({ breakpoints }) => ({
                background: linearGradient(cardContent.main, cardContent.state, cardContent.deg),
                borderRadius: "20px",
                [breakpoints.up("xl")]: {
                  maxWidth: "110px !important",
                },
                [breakpoints.up("xxl")]: {
                  minWidth: "180px",
                  maxWidth: "100% !important",
                },
              })}
            >
              <VuiTypography color="text" variant="button" fontWeight="regular" mb="5px">
                علاوة
              </VuiTypography>
              <VuiTypography color="white" variant="lg" fontWeight="bold">
                1,465
              </VuiTypography>
            </VuiBox>
          </VuiBox>
          <GradientProgress
            percent={70}
            viewport
            size={window.innerWidth >= 1024 ? 200 : window.innerWidth >= 768 ? 170 : 200}
            isGradient
            gradient={{
              angle: 90,
              startColor: "rgba(5, 205, 153, 0)",
              stopColor: "#05CD99",
            }}
            emptyColor="transparent"
          >
            <VuiBox
              display="flex"
              flexDirection="column"
              justifyContent="center"
              alignItems="center"
            >
              <VuiTypography color="text" variant="button" mb="4px">
                أمان
              </VuiTypography>
              <VuiTypography color="white" variant="d5" fontWeight="bold" mb="4px">
                9.3
              </VuiTypography>
              <VuiTypography color="text" variant="button">
                مجموع النقاط
              </VuiTypography>
            </VuiBox>
          </GradientProgress>
        </VuiBox>
      </VuiBox>
    </Card>
  );
}

export default ReferralTracking;
